description:
Перья окрашены в серо-белые и черные чередующиеся полосы, как у кукушки. Для мужских особей характерен одинаковый размер этих полос, а у курочек светлого намного меньше, больше в их окрасе черного. Оперение пышное, перья могут лохматиться. Глядя на этих курочек можно отметить, что каркас и мускулатура у них развиты хорошо, особенно в задней части туловища. Основные внешние черты кур этой породы:

средних размеров голова и шея, соразмерна туловищу птицы;

гребень кур намного меньше, чем у мужских особей и не настолько ярко окрашен;

серьги средней длины и гребень петуха хорошо развиты, имеют сочный красный цвет;

глаза необычного светло коричневого оттенка;

широкая грудная клетка немного выгнута вперед;

голени крепкие с мощной мускулатурой.

Петухи обладают красивой, пышной хвостовой частью, которая украшена длинными перьями. У вылупившихся цыплят этой породы цвет пуха будет черным, только на животике может наблюдаться светлое пятнышко,
Подробности только по телефону

Туалет поможет вам приучить щенка ходить только в одно место, после него у собаки не возникнет проблем с переходом на прогулки на улице.

  Этот туалет может заменить в зимний период любые прогулки на улицу для собак декоративных пород. А также отлично подойдет для собак мелких и средних пород, щенков и пожилых собак, совершающих гигиенические процедуры в помещении.

Коврик, имитирующий траву, доставит особое удовольствие вашему питомцу, после него ваша собака будет справлять нужду на место без промашек. Система домашнего туалета не даст просочиться неприятному запаху наружу до 7 дней. 

Характеристики:

- Размер упаковки: 47 см × 34 см × 6 см;
- Размер (Д × Ш × В): 47 см × 34 см × 6 см;
- Вес: 1,2 кг;

